import {useState} from 'react';

function Home(){
    return (
        <div>
            <h1>Caiqueraaaa</h1>
            <Contador/>
        </div>
    )
    
}


function Contador(){
    const [contador, setContador] = useState(1);

    function adicionarContador(){
        setContador(contador + 1);
    }

    return (
        <div>
            <div>{contador}</div>
            <button onClick={adicionarContador}>+</button>
        </div>
    )
}

export default Home
